import React from 'react';
import style from './recipe.module.css';


const Details = ({ meal, title, calories, image, ingredients, cuisine, diet }) => {

    console.log(meal);
    return (

        <>
            <div className="container">
                <div className="row">
                    <div className="col-6">
                        <img className={style.image} src={[image[0]]} width="300px" alt="" />

                    </div>
                    <div className="col-6">
                        <div className="row">
                            <div className="col-6">
                                <div className="row"><div className="col-6"><div className={style.title}><p>{[title]}</p></div></div></div>

                                <div className="row"><div className="col-6"><div className={style.meal}><p>{[meal]}</p></div></div></div>
                                <div className="row"><div className="col-6"><div className={style.diet}><p> {[diet]} </p></div></div></div>

                                <div className="row"><div className="col-6"><div className={style.cuisine}><p> {[cuisine]} </p></div></div></div>

                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}

export default Details;
